import { all } from "axios";
import React, { useEffect, useState } from "react";
import { useNavigate } from "react-router-dom";
import AllPool from "./AllPool";
import MyPool from "./MyPool";
import "./poolhome.css";

function PoolHome() {
  const navigate = useNavigate();
  const [section, setSection] = useState("1");
  const [allPool, setallPool] = useState([]);

  console.log(section);
  useEffect(() => {
    fetch("http://localhost:8081/allpool")
      .then((response) => response.json())
      .then((data) => setallPool(data))
      .catch((error) => console.log(error));
  }, []);

  return (
    <>
      <div className="poolhomediv">
        {/* <div className="outerbuttondiv">
      <button className="buttondiv"
        onClick={() => {
          setSection("1");
        }}
      >
        Available Pools
      </button>
      <button className="buttondiv"
        onClick={() => {
          setSection("2");
        }}
      >
        My Pools
      </button>
      <button className="buttondiv"
        onClick={() => {
          setSection("3");
        }}
      >
        Joined Pools
      </button>
      <button className="buttondiv"
        onClick={() => {
          setSection("4");
        }}
      >
        Create Pool
      </button>

      </div>
     */}

        <ul class="nav nav-tabs" role="tablist">
          <li class="nav-item" role="presentation">
            <a
              class="nav-link"
              data-bs-toggle="tab"
              href="#home"
              aria-selected="false"
              role="tab"
              tabindex="-1"
              onClick={() => {
                setSection("1");
              }}
            >
              Home
            </a>
          </li>
          <li class="nav-item" role="presentation">
            <a
              class="nav-link active"
              data-bs-toggle="tab"
              href="#profile"
              aria-selected="true"
              role="tab"
              onClick={() => {
                setSection("2");
              }}
            >
              Profile
            </a>
          </li>
          <li class="nav-item" role="presentation">
            <a
              class="nav-link disabled"
              href="#"
              aria-selected="false"
              tabindex="-1"
              role="tab"
              onClick={() => {
                setSection("3");
              }}
            >
              Disabled
            </a>
          </li>
          <li class="nav-item" role="presentation">
            <a
              class="nav-link disabled"
              href="#"
              aria-selected="false"
              tabindex="-1"
              role="tab"
            >
              Disabled
            </a>
          </li>
        </ul>

        <div>
          {(() => {
            switch (section) {
              case "1":
                return (
                  <>
                    {allPool.length > 0 ? <AllPool allPool={allPool} /> : null}
                  </>
                );

              case "2":
                return (
                  <>
                    {allPool.length > 0 ? <MyPool allPool={allPool} /> : null}
                  </>
                );

              case "3":
                return (
                  <>
                    <div>These are my joined pools</div>
                  </>
                );
              default:
                return (
                  <>
                    {allPool.length > 0 ? <AllPool allPool={allPool} /> : null}
                  </>
                );
            }
          })()}
        </div>

        <div>
          <button
            onClick={() => {
              navigate("/signup");
            }}
          >
            LOGOUT
          </button>
        </div>
      </div>
    </>
  );
}

export default PoolHome;
